import React from 'react';

const Searchactivity = () => {
  return (
    <div style={styles.page}>
      <h1>ค้นหากิจกรรม</h1>
      <input type="text" placeholder="ค้นหาด้วยชื่อกิจกรรม..." style={styles.input} />
    </div>
  );
};

const styles = {
  page: {
    padding: '20px',
  },
  input: {
    padding: '10px',
    width: '100%',
    fontSize: '16px',
  },
};

export default Searchactivity;
